import { Box, Stack} from '@mui/system'
import {useAppDispatch,useAppSelector} from '../../store';
import { Typography } from '@mui/material';


const ShowReport = () => {

  const {userList} = useAppSelector((state)=> state.userReducer)

  return (
    <>
      <Box  sx={{padding:"24px 64px 0 64px"}}>
      <Typography sx={{fontSize:"22px",fontFamily:'Inter',fontWeight:"800",color:"#1A191D"}}>Report</Typography>
      <Stack direction="row" spacing={3} mt={"50px"}>
      <Box 
            sx={{
              backgroundColor:"#FFFFFF",
              boxShadow: 2,
              borderRadius:"16px",
              padding:"20px",
            }}>
           <Typography sx={{padding:"10px 20px 20px 20px",fontSize:"20px",fontFamily:'Inter',fontWeight:"600",color:"#1A191D"}}>Total Users</Typography>
        </Box>
        <Box 
            sx={{
              backgroundColor:"#FFFFFF",
              boxShadow: 2,
              borderRadius:"16px",
              padding:"20px",


            }}>
           hello
        </Box>
      </Stack>
    </Box>
    </>
  )
}

export default ShowReport
